          id
          sites {
            blogTitle
            siteUid
            cName
            status
            published
          }
        }
        ...on WebsiteProduct{
          isPublished
          planType
          properties
        }
      }
      status
      subscription {
        commonName
        id
        productName
        status
      }
    }
  }
}

